import React, { useState } from "react";
import CartCard from "../CartCard/CartCard";

const Favorites = () => {
  const [favorites, setFavorites] = useState(true);
  return (
    <>
      <CartCard setFavorites={setFavorites} />
    </>
  );
};

export default Favorites;
